import React from "react";
import { StyleSheet, Text, View } from 'react-native';

export default function Detail( {route} ) {
    const item = route.params.item;
    return (
       
      <View style={styles.main}>
        <Text style={styles.text}>Дата: {item.data}</Text>
        <Text style={styles.text}>Спидометр на начало/конец: {item.data}/{item.data} </Text>
        <Text style={styles.text}>Пробег: {item.data}</Text>
        <Text style={styles.text}>Выручка: {item.data}</Text>
        <Text style={styles.text}>Расходы: {item.data}</Text>
        <Text style={styles.text}>Доход: {item.data}</Text>
      </View>
    );
  }
  
  const styles = StyleSheet.create({
    main: {
      flex: 1,
      paddingTop: 20,      
    },
    text:{
      fontSize: 24,
      textAlign: 'left',
      marginLeft: 20 
    }
  });
